import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import './fonts.css';

const appBarTheme = { flexGrow: 1, shadow: 0}
const buttonTheme = { color: "#2975D8",
                      fontWeight: "bold",
                      fontFamily: "Montserrat",
                      verticalAlign: 'bottom',
                      display: 'inline-block',
                      width: '7%',
                      fontSize: '0.7em',
                      letterSpacing: '0.1em'};
const firstLetter = { fontSize: '1.3em' };

export default function SimpleAppBar() {
  return (
    <Box sx={appBarTheme}>
      <AppBar position="static" sx={{background: "#E9EDE6", boxShadow:'none'}}>
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            EV
          </Typography>
          <Button sx={buttonTheme}><span style={firstLetter} >C</span>ontact</Button>
          <Button sx={buttonTheme}><span style={firstLetter} >L</span>inks</Button>
          <Button sx={buttonTheme}><span style={firstLetter} >R</span>esume</Button>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
